	const [user, setUser] = useState([])

	const getUsers = async () => {
		try {
			let response = await axios.get(`https://jsonplaceholder.typicode.com/users`)
			setUsers(response.data)
		} catch(e) {
			console.log(e.message);
		}
	}

	useEffect(() => {
		getUsers();
	}, [])

	return (
		<div className='py-5'>
