									<th>Website</th>
									<th>Phone</th>
								</tr>
							</thead>
							<tbody>
								<tr key={index}>
									<td>{user.name}</td>
									<td>{user.username}</td>
									<td>{user.email}</td>
									<td>{user.website}</td>
									<td>{user.phone}</td>
								</tr>
								{/* {
									users.map((user, index) => {
										return (
											<tr key={index}>
												<td>{user.name}</td>
												<td>{user.username}</td>
												<td>{user.email}</td>
												<td>{user.website}</td>
												<td>{user.phone}</td>
											</tr>
										)
									})
								} */}
							</tbody>
						</Table>
					</div>
				</div>
			</div>
		</div>
	);
}

export default App;
